import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import Tabs from 'react-bootstrap/Tabs'
import Tab from 'react-bootstrap/Tab'
import video from './videos/dna3.mp4'
import './App.css';

const Video = () => {
  return (
    <div className="container">
      <video autoPlay playsInline muted src={video} loop="true" />
    </div>
  );
};
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools <Video /></p3>
          </h1>
          </Jumbotron>
          <Tabs defaultActiveKey="Description" id="uncontrolled-tab-example">
            <Tab eventKey="Description" title="Description">
              <div style={{ padding: 3}}> Description </div>
            </Tab>
            <Tab eventKey="GC content" title="GC content">
            <div style={{ padding: 10}}> GC content </div>
            </Tab>
            <Tab eventKey="GC content plots" title="GC content plots"></Tab>
            <Tab eventKey="Transcription" title="Transcription"></Tab>
          </Tabs>
      </header>
    </div>

  );
}

export default App;
